import React from 'react';

const iframe_container = {
                left: 0,
                          width: "100%",
                          height: "700px !important",
                          position: "relative",
                          border: "0" 
                        }

                        const iframe = {
                            top: 0,
                            left: 0,
                            width: "100%",
                            height: "100%",
                            position: "absolute",
                            border: 'none'  // Changed from 0 to 'none'
                          };

                          function TikTokEmbed() {
                            return (
                              <div style={iframe_container}>
                                <iframe
                                  src="https://www.tiktok.com/embed/7072819797184171310"
                                  style={iframe}
                                  allowFullScreen
                                  scrolling="no"
                                  width="700px"
                                  height="100%"
                                  allow="encrypted-media;"
                                ></iframe>
                              </div>
                            );
                          }

                          export default TikTokEmbed;
